import React from 'react';
import axios from 'axios'
import TableRow from "./tableR";
let soldiers=[];
class Stable extends React.Component {
    gettingSoldiers = async () => {
        const api_url = await
        axios.get('http://127.0.0.1:7001/soldier/all');
        soldiers= await api_url.data;
        return soldiers;
    }
    render() {
        soldiers=this.gettingSoldiers();
        return (
            <div>
                {
                    soldiers.map(function (soldier) {
                        return <td>{soldier.first_name}</td>
                    })
                }
            </div>
        )
    }
}

export default Stable;
